  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Decisions issued by the Chair and Board
  Members of the Departmental Appeals Board concerning determinations in discretionary,
  project grant programs, including disallowances, terminations and denials of refunding,
  cost allocation plan disapprovals, and rate determinations; determinations in mandatory
  grant programs, including disallowances of state claims under titles I, IV-A (Temporary
  Assistance for Needy Families), IV-D (Child Support Enforcement), IV-E (Foster Care
  and Adoption Assistance), X, XIV, XVI, XIX (Medicaid), and XXI (State Children's
  Health Insurance Program) of the Social Security Act; and appellate review of decisions
  of DAB Civil Remedies Division ALJs, decisions of Food and Drug Administration ALJs
  regarding civil money penalties, and decisions of Department of the Interior ALJs
  in Indian Health Service contract/compact cases. .</p>n\",\n\t\"license_title\":
